import React, { useState, useEffect, useContext } from 'react'
import { AppContext } from '../App';
import { Link } from "react-router-dom"

function Address() {
    const { address } = useContext(AppContext)

    const [addressCopy, setAddressCopy] = useState({ address })

    return (
        <div>
            <div className="list-group">
                {address.street ?
                    <ul className="list-group list-group-flush">
                        <li className="list-group-item">Street      :       {addressCopy.street}</li>
                        <li className="list-group-item">Suite       :       {addressCopy.suite}</li>
                        <li className="list-group-item">City        :       {addressCopy.city}</li>
                        <li className="list-group-item">Zipcode     :       {addressCopy.zipcode}</li>
                        <li className="list-group-item">Geo         : </li>
                        <li className="list-group-item">Lat         :       {addressCopy.geo.lat}</li>
                        <li className="list-group-item">lng         :       {addressCopy.geo.lng}</li>
                        <li className="list-group-item"><Link to='/'>Go Back</Link></li>
                    </ul>
                    :
                    <ul className="list-group list-group-flush">
                        <li className="list-group-item">No Data</li>
                        <li className="list-group-item"><Link to='/'>Go Back</Link></li>
                    </ul>}

            </div>


        </div>
    )
}

export default Address;
